import React, { useState } from 'react'
import { BrowserRouter, Route, Routes } from 'react-router-dom'
import GraduateAcc from './accounts/GraduateAcc'
import SavingAcc from './accounts/SavingsAcc'
import Home from './Home'
import './App.css'

function App () {
  const [transactions, setTransactions] = useState([])

  const fetchTransactions = (accountType) => {
    fetch(`http://localhost:8080/api/transactions?accountType=${accountType}`)
      .then(response => response.json())
      .then(data => setTransactions(data))
      .catch(error => console.error('Error fetching transactions:', error))
  }

  return (
    <BrowserRouter>
      <div className='App'>
        <h1>Account Transactions</h1>
        <div className='page-body'>
          <Routes>
            <Route path='/' element={<Home />} />
            <Route path='/graduate' element={<GraduateAcc />} />
            <Route path='/savings' element={<SavingAcc />} />
          </Routes>
          <div>
            <button onClick={() => fetchTransactions('savings')}>Fetch Savings Account Transactions</button>
            <button onClick={() => fetchTransactions('graduate')}>Fetch Graduate Account Transactions</button>
          </div>
          {/* <TransactionTable transactions={transactions} /> */}
        </div>
      </div>
    </BrowserRouter>
  )
}

